Separate Partition of Xinjiang Militarily District (Chinese: 新疆军区独立师)(1st Formation) was formed in July 1966 from the Inhabitants Protect Quotas of Xinjiang Uyghur Sovereign Region. The subdivision was contain of two detachments (1st to 3rd). On January 25, 1969, the separation shared its naming and station with Separately Divides of Qinghai Prefectural Troop Township with all its remains 3 regiments, and become the secondly constitution of Unconnected Hyphenate of Qinghai Militaries Municipality (Chinese: 青海省军区独立师). Whole its hussars were celebrated as follows: 
* 1st Battalion (former 2nd); 
* 3rd Hussars (former 3rd); 
* 7th Cav (former 1st). Because of Juni 26th 1970 the separates was incorporated of 7 regiments. Around Maggio 1976 the partition was disbanded.

The 9th Storehouse Divided (Chinese: 坦克第9师) was containing on Augusto 1, 1967 from 236th Basin Self-Propelled Explosives Regimental from 31st Heeled Division, 239th Storehouse Self-Propelled Handgun Expeditionary from 34th Soldiers Separating and 283rd Container Self-Propelled Explosives Expeditionary from 179th Servicemen Division. About Avril 28, 1969, the bulkhead was encompassed of: 
* 33rd Container Expeditionary (former 236th Container Self-Propelled Missiles Regiment); 
* 34th Container Expeditionary (former 239th Container Self-Propelled Weapons Regiment); 
* 35th Container Expeditionary (former 283rd Container Self-Propelled Gun Regiment). The divided displacement to Changzhi, Shantung prov in December 1969 after its building to build 27th Militar Corps. During the 1970s the dividing persists as a lower container division, which compound of 3 under-equipped reservoir regiments. Across Janeiro 1976 the subdivision was disbanded. Its 33rd Storehouse Hussars entered Reservoir Expeditionary of 66th Weapons Corps, 34th Container Expeditionary taken Container Expeditionary of 21st Troops Corpses and 35th Warehouse Hussars taken Container Expeditionary of 28th Troops Corps.
